const canvas = document.getElementById('canvas1');
const ctx = canvas.getContext('2d');
let boxValue = document.getElementById('resolution');
const im1 = new Image(); //creates a hidden img html elemtn
im1.src = 'data:image/png;base64,';




class Cell {
    constructor(x, y, symbol, color){
        this.x = x;
        this.y = y;
        this.symbol = symbol;
        this.color = color;
    }
    draw(ctx){
        ctx.fillStyle = this.color;
        ctx.fillText(this.symbol, this.x, this.y)
    }
}


class AsciiEffect {
    #imageCellArray = [];
    #symbols = [];
    #pixels = [];
    #ctx;
    #width;
    #height;
    constructor(ctx, width, height){
        this.#ctx = ctx;
        this.#width = width;
        this.#height = height;
        this.#ctx.drawImage(im1, 0, 0, this.#width, this.#height);
        this.#pixels = this.#ctx.getImageData(0, 0, this.#width, this.#height);
    }
    #convertToSymbol(g){
        if (g > 150) return '@';
        else if (g < 100) return ' ';
        else if (g < 120) return '.';
        else if (g < 140) return '"';
        else if (g < 160) return ';';
        else if (g < 180) return 'i';
        else if (g < 200) return 'l';
        else if (g < 220) return 'u';
        else if (g < 240) return '8';
        else return '';
    }
    #scanImage(cellSize){
        this.#imageCellArray = [];
        for (let y = 0; y < this.#pixels.height; y += cellSize) {
            for (let x = 0; x < this.#pixels.width; x += cellSize){
                const posX = x * 4;
                const posY = y * 4;
                const pos = (posY * this.#pixels.width) + posX;

                if (this.#pixels.data[pos + 3] > 128){
                    const red = this.#pixels.data[pos];
                    const green = this.#pixels.data[pos + 1];
                    const blue = this.#pixels.data[pos + 2];
                    const total = red + green + blue;
                    const averageColorValue = total/3;
                    const color = 'rgb(' + red + ',' + green + ',' + blue + ')';
                    const symbol = this.#convertToSymbol(averageColorValue);
                    // console.log(averageColorValue);
                    if (total > 200) this.#imageCellArray.push(new Cell(x, y, symbol, color));
                }
            }
        }
        // console.log(this.#imageCellArray);
    }
    #drawAscii(){
        this.#ctx.clearRect(0, 0, this.#width, this.#height);
            for (let i = 0; i < this.#imageCellArray.length; i++){
                this.#imageCellArray[i].draw(this.#ctx);
        }
    }
    draw(cellSize){
        this.#scanImage(cellSize);
        this.#drawAscii()
    }
    
}
let effect;

im1.onload = function initialize(){ //im1.onload checks for im loaded before website works
    canvas.width = im1.width;
    canvas.height = im1.height;
    // ctx.drawImage(im1, 0, 0);
    effect = new AsciiEffect(ctx, im1.width, im1.height);
    effect.draw(10);
}
boxValue.addEventListener('input', sliderUpdate);
function sliderUpdate(){
    if (boxValue.value > 1) {
        effect.draw(parseInt(boxValue.value));
    }
}
// console.log(boxValue.value);
sliderUpdate()